package training.cursojava.exercicios.aulas16a17;

public class Exercicio09 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 1; i < 51; i+=2) {
			if ((i % 2) != 0)
				System.out.println(i);
		}
		for (int i = 1; i < 51; i++) {
			if ((i % 2) != 0)
				System.out.println(i);
		}

	}

}
